import '../styles/Tab.css';
import React, {Component} from 'react';
import {ListItem, ListItemText} from '@material-ui/core';

class Tab extends Component{
    render(){
        return <ListItem>
            <ListItemText primary = {this.props.text}/>
        </ListItem>;
    }
}

export default Tab;
